import React from "react";

const StepOne = props => {
  return (
    <div className="row">
      <div className="radio">
        <input
          type="radio"
          name="shape"
          value="Circle"
          onSelect={props.setShape.bind(this)}
        />{" "}
        Circle
      </div>
      <div className="radio">
        <input
          type="radio"
          name="shape"
          value="Square"
          onSelect={props.setShape.bind(this)}
        />{" "}
        Square
      </div>
      <div className="radio">
        <input type="radio" name="shape" value="Ellipse" /> Ellipse
      </div>
      <div className="radio">
        <input type="radio" name="shape" value="Rectangle" /> Rectangle
      </div>
    </div>
  );
};

export default StepOne;
